import React from 'react';
import {Link} from 'react-router-dom';
import Style from './Card.module.css';

export default function Dogcard ({name, image, temperament, temperaments, weight,id}) {

    return (
        <div className={Style.cards}>
            <div className={Style.box}>
                    <h3>
                        <Link to={`/dogs/${id}`}>
                            {name}
                        </Link>
                    </h3>                   
                    <h6>Temperaments: {Array.isArray(temperaments) ? temperaments.map(e => e.name.split(',')) : temperament}</h6>
                    <img src={image} alt="img not found" width="200px" height="200px"/>
                    <span className={Style.score}>Weight: {weight}</span>
            </div>
        </div>
    )
}
